import React from 'react'
import ReactDOM from 'react-dom';
import Timeline from 'react-image-timeline';
import Layout from './../components/Layout';

const events = [{
    date: new Date(2013, 9, 27),
    text: "Sed leo elit, pellentesque sit amet congue quis, ornare nec lorem.",
    title: "Cairo, Egypt",
    imageUrl: "http://github.com/aaron9000/react-image-timeline/blob/master/src/assets/cairo.jpg?raw=true",
},
{
    date: new Date(2014, 9, 27),
    text: "Sed leo elit, pellentesque sit amet congue quis, ornare nec lorem.",
    title: "Cairo, Egypt",
    imageUrl: "http://github.com/aaron9000/react-image-timeline/blob/master/src/assets/cairo.jpg?raw=true",
},
{
    date: new Date(2014, 11, 27),
    text: "Sed leo elit, pellentesque sit amet congue quis, ornare nec lorem.",
    title: "Cairo, Egypt",
    imageUrl: "http://github.com/aaron9000/react-image-timeline/blob/master/src/assets/cairo.jpg?raw=true",
}]

export default class Experiece extends React.Component {
    
    render() {
        return (
            <Layout>
                <div className="container">
				    <Timeline events={events} />
                </div>
                <style jsx>{`
				.container{
                    max-height: 100vh;
					overflow-y: scroll;
                    padding: 2em 4em 1em 4em;
				}
				.container::-webkit-scrollbar { width: 0 !important }
                .rt-footer-container{
                    visibility: hidden !important;
                    max-height: 0px !important
                }
			`}</style>
            </Layout>
        )
    }
}
